import React, { useState, useEffect } from "react"
const Converter = () => {


  const apiCall = async () => {
    try {
      const response = await fetch(`https://api.coingecko.com/api/v3/simple/price?ids=bitcoin&vs_currencies=cad"`);
      const json = await response.json();
      console.log(json);
    } catch (err) {
      console.log(err);
    }
  };

  useEffect(() => {
    (async () => {
      await apiCall();
    })();
  }, []);

  return(
    <div>Converter</div>
  )
}

export default Converter
